import { Link } from 'react-router-dom';
import axios from 'axios';
import Slider, { Range } from 'rc-slider';

import 'rc-slider/assets/index.css';
const wrapperStyle = { width: 400, margin: 50 };
          // <Slider step={20, 'dots'} max={'100'}/>

class SearchProperties extends Component {

  constructor(props) {
    super(props)
    this.state = {
      bathrooms: ''
    }
  }

  onSliderChange = (e) => {
    console.log(e);
  }

  render(){
    return(
      <div className="searchproperties">

            <div style={wrapperStyle}>
          <p>Slider with fixed values</p>
          <Slider min={20} defaultValue={20} marks={{ 20: 20, 40: 40, 100: 100 }} step={null} onChange={this.onSliderChange} />
        </div>

      </div>
    )
  }
}

export default SearchProperties
